import axios from "axios";
import React from "react";
import { useLocation, useNavigate, useParams } from "react-router";
import { Link } from "react-router-dom";
import { useAuthContext } from "../context/AuthContext";

import SearchText from "./SearchText";

export default function Navbar() {
  const navigate = useNavigate();
  const { user, setUser } = useAuthContext();

  const handlerLogOut = (e) => {
    axios.post("/api/users/logout");
    setUser(null);
    navigate("/");
  };
  const valor = useLocation();

  return (
    <header className="header-top">
      <div className="content">
        <div className="nav">
          <div className="nav-wrapper">Nav</div>
          {user ? (
            <>
              <div className="log-tool">
                Welcome {user.name}
                <button className="form-botton" onClick={handlerLogOut}>
                  Logout
                </button>
              </div>
              <div className="search">
                Search
                <Link to="/">
                  <SearchText />
                </Link>
              </div>
            </>
          ) : (
            <div>
              <Link to="/">
                <button className="form-botton">Sing In</button>
              </Link>
              <Link to="/register">
                <button className="form-botton">Sing Up</button>
              </Link>
            </div>
          )}
        </div>
      </div>
    </header>
  );
}
